import React from "react";
import Iframe from 'react-iframe';


const Home = () => {
  return (
    <div>
      <Iframe
        width="450px"
        height="450px"
        id="myId"
        className="myClassname"
        display="initial"
        position="relative"
      />
    </div>
  );
};

export default Home;
